import React, { Component } from 'react'

class EducationLoan extends Component {

    constructor()
    {
        super();
        this.loan=null;
    }

    submitHandler = (e) => {
        e.preventDefault();
        
      }

    render() {
        this.loan=this.props.loan;

        return (
            <div className="container-fluid" onSubmit={this.submitHandler}> 
                <form className="container form-group">
                    <label htmlFor="coureFee">Course fee</label>
                    <input name="coureFee" className="form-control" type="number" min="10" placeholder="Course Fee" required />

                    <label htmlFor="courseName">Course Name</label>
                    <input name="courseName" className="form-control" type="text" minLength="3" placeholder="Course" required />

                    <label htmlFor="fatherName"> Father Name</label>
                    <input name="fatherName" className="form-control" type="text" minLength="2" placeholder="Father's Name" required />

                    <label htmlFor="fatherOccupation">Father Occupation</label>
                    <input name="fatherOccupation" className="form-control" type="text" placeholder="Father's Occupation" required />

                    <label htmlFor="fatherTotalExp">Father Total Experience</label>
                    <input name="fatherTotalExp" className="form-control" type="number" min="1" placeholder="Father's Total Experience (in yrs)" required />

                    <label htmlFor="fatherExpInCur">Father Experience in Current Organisation</label>
                    <input name="fatherExpInCur" className="form-control" type="number" min="1" placeholder="Father's Experience in Current Organisation (in yrs)" required />

                    <label htmlFor="rationCardNo">Ration Card Number</label>
                    <input name="rationCardNo" className="form-control" type="number" minLength="8" placeholder="Ration Card Number" required />

                    <label htmlFor="annualIncome">Annual Income</label>
                    <input name="annualIncome" className="form-control" type="number" min="100" placeholder="Annual Income" required />
                </form>
            </div>
        )
    }
}

export default EducationLoan
